// Helpers/todoData.js

const todoData = [
    {
        id: 1,
        content: "faire ses devoirs",
        done: true
    },
    {
        id: 2,
        content: "ranger sa chambre",
        done: false
    },
    {
        id: 3,
        content: "essuyer la vaisselle",
        done: false
    }
];

export default todoData
